  return (
    <BrowserRouter>
    <div className="App">
    {location.pathname === '/' ? undefined : <Nav />}
      <Routes>
        <Route exact path= '/dogs' component ={landingPage}/>
        <Route path = '/home' component ={Home}/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
